import React from "react";
import "./style.css";

const Manu = () => {
  return (
    <>
      <div class="rc_nav" id="centered_nav">
        <a href="#home" title="Home">
          Home
        </a>
        <a href="#services" title="Services">
          Services
        </a>
        <a href="#about" title="About">
          About
        </a>
        <a href="#contact" title="Contact">
          Contact
        </a>
      </div>
    </>
  );
};

export default Manu;
